(()=>{"use strict";(e=>{const t=document.getElementById("timer-hours"),n=document.getElementById("timer-minutes"),i=document.getElementById("timer-seconds"),m=()=>{let e=(new Date("31 january 2022").getTime()-(new Date).getTime())/1e3;return{timeRemaining:e,hours:Math.floor(e/60/60),minutes:Math.floor(e/60%60),seconds:Math.floor(e%60)}},o=()=>{let e=m();t.textContent=("0"+e.hours).slice(-2),n.textContent=("0"+e.minutes).slice(-2),i.textContent=("0"+e.seconds).slice(-2)};m>0&&o(),setInterval((()=>{let e=m();e.timeRemaining>0?o():0===e.timeRemaining&&clearInterval(o)}),1e3)})()})();